const API_URL = process.env.REACT_APP_API_URL + "/certifications"; // no trailing slash

// Fetch all
fetch(`${API_URL}/?user_id=temp_user`)

// Add
fetch(`${API_URL}/`, { method: "POST", body: formData })

// Delete
fetch(`${API_URL}/${id}?user_id=temp_user`, { method: "DELETE" })
